+package com.microsoft.identity.client;
+
+import static com.microsoft.identity.client.GlobalSettingsConfigurationFactory.initializeGlobalConfiguration;
+
+import android.content.Context;
+
+import androidx.annotation.NonNull;
+import androidx.annotation.WorkerThread;
+
+import com.microsoft.identity.client.exception.MsalClientException;
+import com.microsoft.identity.client.exception.MsalException;
+import com.microsoft.identity.common.logging.Logger;
+
+import java.io.File;
+
+/**
+ * Singleton class used to initialize global configurations for the library.
+ */
+public class GlobalSettings {
+    private static final String TAG = GlobalSettings.class.getSimpleName();
+    public static final String NO_GLOBAL_SETTINGS_WARNING = "Global settings have not been initialized before the creation of this PCA Configuration.";
+    public static final String GLOBAL_INIT_AFTER_PCA_ERROR_CODE = "pca_created_before_global";
+    public static final String GLOBAL_INIT_AFTER_PCA_ERROR_MESSAGE = "Global initialization was attempted after a PublicClientApplicationConfiguration instance was already created. Please initialize global settings before any PublicClientApplicationConfiguration instance is created.";
+    public static final String GLOBAL_ALREADY_INITIALIZED_ERROR_CODE = "global_already_initialized";
+    public static final String GLOBAL_ALREADY_INITIALIZED_ERROR_MESSAGE = "Attempting to load global settings configuration after it has already been initialized.";
+
+    /**
+     * Singleton instance for this class, already initialized.
+     */
+    private final static GlobalSettings mGlobalSettingsSingleton = new GlobalSettings();
+
+    /**
+     * Holds configuration fields from a global config file.
+     */
+    private GlobalSettingsConfiguration mGlobalSettingsConfiguration;
+
+    /**
+     * Boolean showing if the global settings have been initialized.
+     */
+    private boolean mGlobalSettingsInitialized = false;
+
+    /**
+     * Boolean showing that a {@link PublicClientApplicationConfiguration} was created and tried to merge with global before global was initialized.
+     * If loadGlobalConfigurationFile() is called after this, throw an exception.
+     *
+     * Global cannot be initialized if a {@link PublicClientApplicationConfiguration} was already created.
+     */
+    private boolean mPCAMergeAttempted = false;
+
+    /**
+     * Lock object for synchronizing pca creation and global settings initialization.
+     */
+    private final Object mGlobalSettingsLock = new Object();
+
+    /**
+     * Private Constructor for Singleton
+     */
+    private GlobalSettings() {
+        // Do nothing
+    }
+
+    /**
+     * Load the global configuration file using the context, resource id of the configuration file, and a listener.
+     *
+     * @param context Context of the app.
+     * @param configFileResourceId Resource Id for the configuration file.
+     * @param listener Handles success and error messages.
+     */
+    @WorkerThread
+    public static void loadGlobalConfigurationFile(@NonNull final Context context,
+                                                   final int configFileResourceId,
+                                                   @NonNull final GlobalSettingsListener listener) {
+        synchronized (mGlobalSettingsSingleton.mGlobalSettingsLock) {
+            if (mGlobalSettingsSingleton.mGlobalSettingsInitialized) {
+                listener.onError(new MsalClientException(GLOBAL_ALREADY_INITIALIZED_ERROR_CODE,
+                        GLOBAL_ALREADY_INITIALIZED_ERROR_MESSAGE));
+                return;
+            }
+
+            if (mGlobalSettingsSingleton.mPCAMergeAttempted) {
+                listener.onError(new MsalClientException(GLOBAL_INIT_AFTER_PCA_ERROR_CODE,
+                        GLOBAL_INIT_AFTER_PCA_ERROR_MESSAGE));
+                return;
+            }
+
+            setGlobalConfiguration(
+                    initializeGlobalConfiguration(context, configFileResourceId),
+                    listener
+            );
+        }
+    }
+
+    /**
+     * Load the global configuration file using the configuration file and a listener.
+     *
+     * @param configFile Configuration file.
+     * @param listener Handles success and error messages.
+     */
+    @WorkerThread
+    public static void loadGlobalConfigurationFile(@NonNull final File configFile,
+                                                   @NonNull final GlobalSettingsListener listener) {
+        synchronized (mGlobalSettingsSingleton.mGlobalSettingsLock) {
+            if (mGlobalSettingsSingleton.mGlobalSettingsInitialized) {
+                listener.onError(new MsalClientException(GLOBAL_ALREADY_INITIALIZED_ERROR_CODE,
+                        GLOBAL_ALREADY_INITIALIZED_ERROR_MESSAGE));
+                return;
+            }
+
+            if (mGlobalSettingsSingleton.mPCAMergeAttempted) {
+                listener.onError(new MsalClientException(GLOBAL_INIT_AFTER_PCA_ERROR_CODE,
+                        GLOBAL_INIT_AFTER_PCA_ERROR_MESSAGE));
+                return;
+            }
+
+            setGlobalConfiguration(
+                    initializeGlobalConfiguration(configFile),
+                    listener
+            );
+        }
+    }
+
+    @WorkerThread
+    private static void setGlobalConfiguration(@NonNull final GlobalSettingsConfiguration globalConfiguration,
+                                               @NonNull final GlobalSettingsListener listener) {
+        mGlobalSettingsSingleton.mGlobalSettingsConfiguration = globalConfiguration;
+        mGlobalSettingsSingleton.mGlobalSettingsInitialized = true;
+        listener.onSuccess("Global configuration initialized.");
+    }
+
+    @WorkerThread
+    protected PublicClientApplicationConfiguration mergeConfigurationWithGlobal(final @NonNull PublicClientApplicationConfiguration developerConfig) {
+        synchronized (mGlobalSettingsSingleton.mGlobalSettingsLock) {
+            mPCAMergeAttempted = true;
+
+            if (!mGlobalSettingsSingleton.mGlobalSettingsInitialized) {
+                Logger.warn(TAG + "mergeConfigurationWithGlobal",
+                        GlobalSettings.NO_GLOBAL_SETTINGS_WARNING);
+                return developerConfig;
+            }
+
+            developerConfig.mergeGlobalConfiguration(mGlobalSettingsSingleton.mGlobalSettingsConfiguration);
+            developerConfig.validateConfiguration();
+            return developerConfig;
+        }
+    }
+
+    protected static GlobalSettings getInstance() {', 'path': 'msal/src/main/java/com/microsoft/identity/client/GlobalSettings.java', 'position': 169, 'original_position': 169, 'commit_id': 'd027711f7f7d8d42fd504d2a5658ff4e45f60a00', 'original_commit_id': 'd027711f7f7d8d42fd504d2a5658ff4e45f60a00', 'user': {'login': 'shahzaibj', 'id': 37125644, 'node_id': 'MDQ6VXNlcjM3MTI1NjQ0', 'avatar_url': 'https://avatars.githubusercontent.com/u/37125644?v=4', 'gravatar_id': '', 'url': 'https://api.github.com/users/shahzaibj', 'html_url': 'https://github.com/shahzaibj', 'followers_url': 'https://api.github.com/users/shahzaibj/followers', 'following_url': 'https://api.github.com/users/shahzaibj/following{/other_user}', 'gists_url': 'https://api.github.com/users/shahzaibj/gists{/gist_id}', 'starred_url': 'https://api.github.com/users/shahzaibj/starred{/owner}{/repo}', 'subscriptions_url': 'https://api.github.com/users/shahzaibj/subscriptions', 'organizations_url': 'https://api.github.com/users/shahzaibj/orgs', 'repos_url': 'https://api.github.com/users/shahzaibj/repos', 'events_url': 'https://api.github.com/users/shahzaibj/events{/privacy}', 'received_events_url': 'https://api.github.com/users/shahzaibj/received_events', 'type': 'User', 'site_admin': False}, 'body': "I mean my point is that it probably needs to be either `public` or `package-private` or `private`. The one we pick depends on how we want the API to be accessed. `protected` is usually used if we intend to allow usage of the API by any classes that extend this class. I don't think there are currently any children of `GlobalSettings` so I'm not sure why we would want `protected`.", 'created_at': '2022-04-14T05:48:44Z', 'updated_at': '2022-04-14T05:48:44Z', 'html_url': 'https://github.com/AzureAD/microsoft-authentication-library-for-android/pull/1604#discussion_r850102927', 'pull_request_url': 'https://api.github.com/repos/AzureAD/microsoft-authentication-library-for-android/pulls/1604', 'author_association': 'CONTRIBUTOR', '_links': {'self': {'href': 'https://api.github.com/repos/AzureAD/microsoft-authentication-library-for-android/pulls/comments/850102927'}, 'html': {'href': 'https://github.com/AzureAD/microsoft-authentication-library-for-android/pull/1604#discussion_r850102927'}, 'pull_request': {'href': 'https://api.github.com/repos/AzureAD/microsoft-authentication-library-for-android/pulls/1604'}}, 'reactions': {'url': 'https://api.github.com/repos/AzureAD/microsoft-authentication-library-for-android/pulls/comments/850102927/reactions', 'total_count': 0, '+1': 0, '-1': 0, 'laugh': 0, 'hooray': 0, 'confused': 0, 'heart': 0, 'rocket': 0, 'eyes': 0}, 'start_line': None, 'original_start_line': None, 'start_side': None, 'line': 169, 'original_line': 169, 'side': 'RIGHT', 'in_reply_to_id': 849778135}, 'pull_request': {'url': 'https://api.github.com/repos/AzureAD/microsoft-authentication-library-for-android/pulls/1604', 'id': 881219289, 'node_id': 'PR_kwDOA9W-Qc40hlbZ', 'html_url': 'https://github.com/AzureAD/microsoft-authentication-library-for-android/pull/1604', 'diff_url': 'https://github.com/AzureAD/microsoft-authentication-library-for-android/pull/1604.diff', 'patch_url': 'https://github.com/AzureAD/microsoft-authentication-library-for-android/pull/1604.patch', 'issue_url': 'https://api.github.com/repos/AzureAD/microsoft-authentication-library-for-android/issues/1604', 'number': 1604, 'state': 'open', 'locked': False, 'title': 'Split MSAL (Global) and PCA-Specific Configuration', 'user': {'login': 'fadidurah', 'id': 88730756, 'node_id': 'MDQ6VXNlcjg4NzMwNzU2', 'avatar_url': 'https://avatars.githubusercontent.com/u/88730756?v=4', 'gravatar_id': '', 'url': 'https://api.github.com/users/fadidurah', 'html_url': 'https://github.com/fadidurah', 'followers_url': 'https://api.github.com/users/fadidurah/followers', 'following_url': 'https://api.github.com/users/fadidurah/following{/other_user}', 'gists_url': 'https://api.github.com/users/fadidurah/gists{/gist_id}', 'starred_url': 'https://api.github.com/users/fadidurah/starred{/owner}{/repo}', 'subscriptions_url': 'https://api.github.com/users/fadidurah/subscriptions', 'organizations_url': 'https://api.github.com/users/fadidurah/orgs', 'repos_url': 'https://api.github.com/users/fadidurah/repos', 'events_url': 'https://api.github.com/users/fadidurah/events{/privacy}', 'received_events_url': 'https://api.github.com/users/fadidurah/received_events', 'type': 'User', 'site_admin': False}, 'body': "**What**
Adding support for global configuration, where developers can designate global fields that they'd want all PCA instances to have through a global configuration file. Refer to the design document PR below.
https://identitydivision.visualstudio.com/DevEx/_git/AuthLibrariesApiReview/pullrequest/4763

**Why**
Many of our configuration fields are intended to be global in scope and shouldn't differ between instances of PCA. Want to enforce this field selection between which fields are set in global or PCA-specific configuration files.

**How**
In this design, the global settings initialization is done before the PCA is created in the developer's app. Once initialization is done, the global settings will be available as a static field, which can be used later in the PCA construction to merge the PCAConfiguration object with the fields from the global configuration. This is not a breaking change, developers will be able to keep their current structure where they supply a config file for each PCA instance, but a warning will be logged whenever global configuration initialization is missing.

**Testing**
Add testing to confirm configuration merging between `GlobalSettingsConfiguration` and `PublicClientApplicationConfiguration` is working correctly. Add testing to confirm exception if global is initialized after PCA is already created, warning if global is not initialized. Add unit testing to check global fields overriding PCA fields.", 'created_at': '2022-03-16T11:02:37Z', 'updated_at': '2022-04-14T05:48:44Z', 'closed_at': None, 'merged_at': None, 'merge_commit_sha': 'd2b2da57f4c4928dffc941f48b003fdbc8308a76', 'assignee': None, 'assignees': [], 'requested_reviewers': [{'login': 'shoatman', 'id': 8864677, 'node_id': 'MDQ6VXNlcjg4NjQ2Nzc=', 'avatar_url': 'https://avatars.githubusercontent.com/u/8864677?v=4', 'gravatar_id': '', 'url': 'https://api.github.com/users/shoatman', 'html_url': 'https://github.com/shoatman', 'followers_url': 'https://api.github.com/users/shoatman/followers', 'following_url': 'https://api.github.com/users/shoatman/following{/other_user}', 'gists_url': 'https://api.github.com/users/shoatman/gists{/gist_id}', 'starred_url': 'https://api.github.com/users/shoatman/starred{/owner}{/repo}', 'subscriptions_url': 'https://api.github.com/users/shoatman/subscriptions', 'organizations_url': 'https://api.github.com/users/shoatman/orgs', 'repos_url': 'https://api.github.com/users/shoatman/repos', 'events_url': 'https://api.github.com/users/shoatman/events{/privacy}', 'received_events_url': 'https://api.github.com/users/shoatman/received_events', 'type': 'User', 'site_admin': False}, {'login': 'iamgusain', 'id': 75644120, 'node_id': 'MDQ6VXNlcjc1NjQ0MTIw', 'avatar_url': 'https://avatars.githubusercontent.com/u/75644120?v=4', 'gravatar_id': '', 'url': 'https://api.github.com/users/iamgusain', 'html_url': 'https://github.com/iamgusain', 'followers_url': 'https://api.github.com/users/iamgusain/followers', 'following_url': 'https://api.github.com/users/iamgusain/following{/other_user}', 'gists_url': 'https://api.github.com/users/iamgusain/gists{/gist_id}', 'sta