iptions_url': 'https://api.github.com/users/fadidurah/subscriptions', 'organizations_url': 'https://api.github.com/users/fadidurah/orgs', 'repos_url': 'https://api.github.com/users/fadidurah/repos', 'events_url': 'https://api.github.com/users/fadidurah/events{/privacy}', 'received_events_url': 'https://api.github.com/users/fadidurah/received_events', 'type': 'User', 'site_admin': False}, 'body': "**What**
Adding support for global configuration, where developers can designate global fields that they'd want all PCA instances to have through a global configuration file. Refer to the design document PR below.
https://identitydivision.visualstudio.com/DevEx/_git/AuthLibrariesApiReview/pullrequest/4763

**Why**
Many of our configuration fields are intended to be global in scope and shouldn't differ between instances of PCA. Want to enforce this field selection between which fields are set in global or PCA-specific configuration files.

**How**
In this design, the global settings initialization is done before the PCA is created in the developer's app. Once initialization is done, the global settings will be available as a static field, which can be used later in the PCA construction to merge the PCAConfiguration object with the fields from the global configuration. This is not a breaking change, developers will be able to keep their current structure where they supply a config file for each PCA instance, but a warning will be logged whenever global configuration initialization is missing.

