+                return;
+            }
+
+            setGlobalConfiguration(
+                    initializeGlobalConfiguration(configFile),
+                    listener
+            );
+        }
+    }
+
+    @WorkerThread
+    private static void setGlobalConfiguration(@NonNull final GlobalSettingsConfiguration globalConfiguration,
