Overview of Changes

- **IAndroidKeyStoreKeyManager** renamed to **IKeyStoreKeyManager**
- **DeviceKeyManager** renamed to **AndroidDeviceKeyManager**
- Most of the **AndroidDeviceKeyManager** code moves to **AbstractKeyStoreKeyManager** for code sharing between platforms.
