Adding support for global configuration, where developers can designate global fields that they'd want all PCA instances to have through a global configuration file. Refer to the design document PR below.
https://identitydivision.visualstudio.com/DevEx/_git/AuthLibrariesApiReview/pullrequest/4763

**Why**
Many of our configuration fields are intended to be global in scope and shouldn't differ between instances of PCA. Want to enforce this field selection between which fields are set in global or PCA-specific configuration files.

**How**
In this design, the global settings initialization is done before the PCA is created in the developer's app. Once initialization is done, the global settings will be available as a static field, which can be used later in the PCA construction to merge the PCAConfiguration object with the fields from the global configuration. This is not a breaking change, developers will be able to keep their current structure where they supply a config file for each PCA instance, but a warning will be logged whenever global configuration initialization is missing.

**Testing**
Add testing to confirm configuration merging between `GlobalSettingsConfiguration` and `PublicClientApplicationConfiguration` is working correctly. Add testing to confirm exception if global is initialized after PCA is already created, warning if global is not initialized. Add unit testing to check global fields overriding PCA fields.", 'created_at': '2022-03-16T11:02:37Z', 'updated_at': '2022-04-07T04:03:44Z', 'closed_at': None, 'merged_at': None, 'merge_commit_sha': 'd2b2da57f4c4928dffc941f48b003fdbc8308a76', 'assignee': None, 'assignees': [], 'requested_reviewers': [{'login': 'shoatman', 'id': 8864677, 'node_id': 'MDQ6VXNlcjg4NjQ2Nzc=', 'avatar_url': 'https://avatars.githubusercontent.com/u/8864677?v=4', 'gravatar_id': '', 'url': 'https://api.github.com/users/shoatman', 'html_url': 'https://github.com/shoatman', 'followers_url': 'https://api.github.com/users/shoatman/followers', 'following_url': 'https://api.github.com/users/shoatman/following{/other_user}', 'gists_url': 'https://api.github.com/users/shoatman/gists{/gist_id}', 'starred_url': 'https://api.github.com/users/shoatman/starred{/owner}{/repo}', 'subscriptions_url': 'https://api.github.com/users/shoatman/subscriptions', 'organizations_url': 'https://api.github.com/users/shoatman/orgs', 'repos_url': 'https://api.github.com/users/shoatman/repos', 'events_url': 'https://api.github.com/users/shoatman/events{/privacy}', 'received_events_url': 'https://api.github.com/users/shoatman/received_events', 'type': 'User', 'site_admin': False}, {'login': 'shahzaibj', 'id': 37125644, 'node_id': 'MDQ6VXNlcjM3MTI1NjQ0', 'avatar_url': 'https://avatars.githubusercontent.com/u/37125644?v=4', 'gravatar_id': '', 'url': 'https://api.github.com/users/shahzaibj', 'html_url': 'https://github.com/shahzaibj', 'followers_url': 'https://api.github.com/users/shahzaibj/followers', 'following_url': 'https://api.github.com/users/shahzaibj/following{/other_user}', 'gists_url': 'https://api.github.com/users/shahzaibj/gists{/gist_id}', 'sta